export default function Block(props) {
    return (
        <div className="container">
            <h1>{props.title}</h1>
            <p>{props.subtitle}</p>
        </div>
    );
}

class LikeButton extends React.Component {
    constructor(props) {
      super(props);
      this.state = { liked: false };
    }
  
    render() {
      if (this.state.liked) {
        return 'You liked this.';
      }
  
      return e(
        'button',
        { onClick: () => this.setState({ liked: true }) },
        'Like'
      );
    }
  }
